import React from 'react';
import './App.css';
import SearchBar from './components/SearchBar/SearchBar.jsx';
import AddTrainerButton from './components/AddTrainerButton/AddTrainerButton';
import DeleteTrainerButton from './components/DeleteTrainerButton/DeleteTrainerButton';
// import TrainerProfile from './components/TrainerProfile/TrainerProfile';
import Row from "react-bootstrap/Row";
import Col from "react-bootstrap/Col";
import Container from 'react-bootstrap/Container';
import PokemonProfile from './components/PokemonProfile/PokemonProfile';

function App() {
  return (
    <div className="App">
      <SearchBar/>
      <Container className="trainerButtons">
        <Row className="justify-content-lg-center">
          <Col md="6">
            <AddTrainerButton/>
          </Col>
          <Col md="6">
            <DeleteTrainerButton/>
          </Col>
        </Row>
      </Container>
      <PokemonProfile/>
    </div>
  );
}

export default App;
